s.x:
var $bm_rt;
var x, y;
x = effect('Regang <--> Susut')('Slider');
y = $bm_sub(200, effect('Regang <--> Susut')('Slider'));
$bm_rt = [
    x,
    y
];

v.x:
var $bm_rt;
var amp, freq, decay, n, time_max, n, t, t, v;
if (effect('Elastis On/Off')('Checkbox') == 0) {
    $bm_rt = effect('Regang <--> Susut')('Slider');
} else {
    amp = 0.1;
    freq = 2;
    decay = $bm_sub(10, effect('Elastis [1-10]')('Slider'));
    n = 0;
    $bm_rt = time_max = 4;
    if (numKeys > 0) {
        $bm_rt = n = nearestKey(time).index;
        if (key(n).time > time) {
            n--;
        }
    }
    if (n == 0) {
        $bm_rt = t = 0;
    } else {
        $bm_rt = t = $bm_sub(time, key(n).time);
    }
    if (n > 0 && t < time_max) {
        v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
        $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
    } else {
        $bm_rt = value;
    }
}

